# Updated function to extract reviews, ratings, review title, and review date from a single page
def extract_reviews_and_ratings(page_url):
    headers = {
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 "
                      "(KHTML, like Gecko) Chrome/58.0.3029.110 Safari/537.3"
    }
    response = requests.get(page_url, headers=headers)
    soup = BeautifulSoup(response.content, "html.parser")
    
    # Find the product title
    product_title_tag = soup.find("a", {"data-hook": "product-link"})
    product_title = product_title_tag.text.strip() if product_title_tag else "Unknown Product"
    
    # Find all review containers
    review_containers = soup.find_all("div", {"data-hook": "review"})
    
    reviews = []
    ratings = []
    review_titles = []
    review_dates = []
    
    # Extract review text, ratings, review title, and review date from each container
    for container in review_containers:
        review_text_tag = container.find("span", {"data-hook": "review-body"})
        review_text = review_text_tag.get_text(strip=True) if review_text_tag else "No review text"
        
        rating_tag = container.find("i", {"data-hook": "review-star-rating"})
        rating = rating_tag.get_text(strip=True) if rating_tag else "No rating"
        
        review_title_tag = container.find("a", {"data-hook": "review-title"})
        review_title = review_title_tag.get_text(strip=True) if review_title_tag else "No review title"
        
        review_date_tag = container.find("span", {"data-hook": "review-date"})
        review_date = review_date_tag.get_text(strip=True) if review_date_tag else "No review date"
        
        reviews.append(review_text)
        ratings.append(rating)
        review_titles.append(review_title)
        review_dates.append(review_date)
    
    return product_title, reviews, ratings, review_titles, review_dates

# Initialize empty lists to store all reviews and ratings
all_reviews = []
all_ratings = []
all_review_titles = []
all_review_dates = []
product_titles = []

# Iterate over each URL and extract data
for url in urls:
    for page_num in range(1, 10):  # You can adjust the range as needed
        page_url = f"{url}&pageNumber={page_num}"
        product_title, reviews, ratings, review_titles, review_dates = extract_reviews_and_ratings(page_url)
        
        product_titles.extend([product_title] * len(reviews))
        all_reviews.extend(reviews)
        all_ratings.extend(ratings)
        all_review_titles.extend(review_titles)
        all_review_dates.extend(review_dates)

# Combine reviews and ratings into a DataFrame
data = {
    'Product Title': product_titles,
    'Review Title': all_review_titles,
    'Review Date': all_review_dates,
    'Reviews': all_reviews,
    'Ratings': all_ratings
}
reviews_df = pd.DataFrame(data)

# Remove duplicate reviews
reviews_df.drop_duplicates(subset=['Review Title', 'Review Date', 'Reviews'], inplace=True)

# Save the reviews to an Excel file
output_path = 'all_reviews_with_ratings_and_titles_multiple_products.csv'  # Use a simple filename to save in the current working directory
reviews_df.to_excel(output_path, index=False)

print(f"Extracted {len(reviews_df)} unique reviews with ratings, review titles, and review dates from multiple products.")
